function getDaysInMonth(e,t){"use strict";return new Date(e,t+1,0).getDate()}function getDayOfWeek(e,t){"use strict";return new Date(e,t,1).getDay()}function createArray(e,t){"use strict";for(var r=[],n=0;n<t-1;n++)r.push("");for(var a=0;a<e;a++)r.push(a+1);if(r.length/7%1!=0)for(;r.length/7%1!=0;)r.push("");for(var o=[];r.length>0;)o.push(r.splice(0,7));return o}function writeHeaders(e){"use strict";var t=["January","Feburary","March","April","May","June","July","August","September","October","November","December"];null!==e?document.getElementById(e).innerHTML='<div class="buttons"><a href="#" onClick="changeMonth(-1)"><</a>'+t[CurrentMonth]+" "+CurrentYear+'<a href="#" onClick="changeMonth(1)">></a></div><table class="table"><thead><tr><th scope="col">M</th><th scope="col">T</th><th scope="col">W</th><th scope="col">T</th><th scope="col">F</th><th scope="col">S</th><th scope="col">S</th></thead><tbody id="tCalendarBody"></tbody></table>':console.log("id is not set")}function writeRows(e,t){"use strict";var r="<tr>";r+="<tr>";for(var n=0;n<t.length;n++){for(var a=0;a<t[0].length;a++)r+="<td>"+t[n][a]+"</td>";r+="</tr>"}document.getElementById(e).innerHTML=r}function createTable(e,t){"use strict";writeHeaders(t),writeRows("tCalendarBody",e)}function calendar(e,t,r){"use strict";var n=null,a=null;if(null!==e){if(null===n||null===a){var o=new Date;n=o.getMonth(),a=o.getFullYear()}else n=r,a=t;createTable(createArray(getDaysInMonth(a,n),getDayOfWeek(a,n)),e)}else console.log("ID for the calendar to load to must be parsed")}function changeMonth(e){"use strict";12==(CurrentMonth+=e)&&(CurrentMonth=0,CurrentYear+=1),-1==CurrentMonth&&(CurrentMonth=11,CurrentYear+=-1),calendar("test",CurrentYear,CurrentMonth)}var CurrentYear=0,CurrentMonth=0;
